import React from "react";

class Showcase extends React.Component {
  videoShowcase = () => {
    return this.props.videos.map((mov) => (
      <img key={mov.id} src={mov.url} alt={mov.id} />
    ));
  };

  render() {
    return <div>{this.videoShowcase()}</div>;
  }
}

export default Showcase;
